/* Trigger structure for table `shade` */

DELIMITER $$

/*!50003 DROP TRIGGER*//*!50032 IF EXISTS */ /*!50003 `shade_notification` */$$

/*!50003 CREATE */ /*!50017 DEFINER = 'root'@'localhost' */ /*!50003 TRIGGER `shade_notification` AFTER UPDATE ON `shade` FOR EACH ROW begin
--    		INSERT INTO notification (id,message,TYPE,STATUS) VALUES (NULL,new.shade_id,1,1);
--    		INSERT INTO notification (id,message,TYPE,STATUS) VALUES (NULL,old.shade_id,1,1);
	if new.quantity < 100 and old.quantity >= 100 then
		if new.shade_id >= 801 and new.shade_id <=803 then
			INSERT INTO notification (id,message,type,status) VALUES (null,concat("Shade ",new.shade_name," is less than 100"),1,1);
		end if;
	end if;
	
	
	IF new.quantity < 50 AND old.quantity >= 50 THEN
		IF new.shade_id <> 801 and new.shade_id <> 802 and new.shade_id <> 803 THEN
			INSERT INTO notification (id,message,TYPE,STATUS) VALUES (NULL,CONCAT("Shade ",new.shade_name," is less than 50"),1,1);
		END IF;
	END IF;
	
	End */$$


